    public SettingPairs getSettingPairs(string currentSettings)
    {
        return getSettingPairs(getSettingList(currentSettings));
    }

    public SettingPairs getSettingPairs(List<Setting> settingList)
    {
        string settingsJSON = "{";
        int tempResultInt;
        double tempResultDouble;
        for (int settingsIndex = 0; settingsIndex < settingList.Count; ++settingsIndex)
            settingsJSON += (settingsIndex == 0 ? "" : ",") + "\"" + settingList[settingsIndex].name.ToLower().Replace(' ', '_') + "\":" + (!(int.TryParse(settingList[settingsIndex].currentValue, out tempResultInt) || double.TryParse(settingList[settingsIndex].currentValue, out tempResultDouble)) ? "\"" : "") + settingList[settingsIndex].currentValue + (!(int.TryParse(settingList[settingsIndex].currentValue, out tempResultInt) || double.TryParse(settingList[settingsIndex].currentValue, out tempResultDouble)) ? "\"" : "");
        settingsJSON += "}";
        return settingsJSON.FromJson<SettingPairs>();
    }

    public List<Setting> getSettingList(string currentSettings)
    {
        List<Setting> settingsList = new List<Setting>();
        string settingString = currentSettings.Substring(1, currentSettings.Length - 2);
        string[] settings = settingString.Split(new string[] { ",{\"category\":" }, StringSplitOptions.None);
        for (int settingIndex = 0; settingIndex < settings.Length; ++settingIndex)
        {
            string setting = (settingIndex == 0 ? "" : "{\"category\":") + settings[settingIndex];
            setting = setting.Replace("\r\n", "").Replace("\r", "").Replace("\n", "");
            if (setting[0] == '[')
                setting = setting.Substring(1);
            if (setting[setting.Length - 1] == ']')
                setting = setting.Substring(0, setting.Length - 1);
            settingsList.Add(setting.FromJson<Setting>());
        }
        return settingsList;
    }

    public string getSettingsJSON(List<Setting> settingList)
    {
        string settings = "[";
        for (int settingIndex = 0; settingIndex < settingList.Count; ++settingIndex)
        {
            string settingsString = "";
            settingsString += (settingIndex > 0 ? "," : "") + settingList[settingIndex].ToJson();
            settings += settingsString;
        }
        settings += "]";
        return settings;
    }
